function showActivities() {
    module('server.log.ApacheLogParser').load(true)
    var text = this.get('resultText');
    var userName = this.get('UserName').textString || this.world().getUserName();
    var repoURL = '/repository/webwerkstatt';
    var currentDate = "",
        currentTime = "";

    this.doSearch(
        "\"\- "+userName + ".* " + "" + ".*"+"xhtml"+"\"", 
        ["", ".1", ".2.gz", ".3.gz",].collect(
            function(ea) { return '/var/log/apache2/other_vhosts_access.log' + ea}),
        function(report) {
            var visitedWorlds = report
                .select(function(ea) { return ea.url.include("xhtml") })
                .select(function(ea) { return ea.users().include(userName) })
                // .sortBy(function(ea) { return ea.usages.length }).reverse()
            var items = visitedWorlds.collect(function(ea) {
                var url = ea.url.replace(repoURL, ""),
                    users = ea.users().without('-'),
                    usersString = users.length == 0 ? '' : ' by ' + users.join(', '),
                    howOften = '' + ea.usages.length,
                    last = ea.usages.sortBy(function(usage) { return usage.dateAndTime }).last(),
                    lastDate = '' + last.dateAndTime.format('yy-mm-dd'),
                    lastTime = '' + last.dateAndTime.format('HH:MM');

                // only show new date and time when different from last
                var s = "";
                if (lastDate == currentDate) {
                    s +=  "        \t"
                } else {
                    s += lastDate + "\t";
                    currentDate = lastDate ;
                    currentTime = ""
                }
                if (lastTime == currentTime) {
                    s +=  "        \t"
                } else {
                    s += lastTime + "\t";
                    currentTime = lastTime ;
                }
                return {
                    islistItem: true,
                    string: s + howOften + "\t" + url,
                    value: ea.url,
                }
            })
            text.setTextString(items.pluck('string').join('\n'));
            text.applyStyle({textColor: Color.darkGray})
            text.emphasizeRegex(/[^\/]*?\.(xhtml)/g, {color: Color.blue})
        })
}

