function doSearch(searchString, logFiles, callback, optLines) {
        var lines = optLines || 100000,
            startTime = Date.now(),
            server = Global.server.log.ApacheLogParser.createCmdLineServerInterface(),
            cmd = 'zgrep -e ' + searchString + ' ' + logFiles.join(" ");
            connect(server, 'result', {callback: callback}, 'callback', {
            converter: function(result) {
                alertOK('Processing server data (loaded in ' + (Date.now() - startTime) + "ms)")
                return parser.createReportsByURLFromLogInfos(
                    parser.convertRawResultToApacheLogInfos(result)) },
            varMapping: {parser: Global.server.log.ApacheLogParser, startTime: startTime}
        });
        server.runCommand(cmd)
}

